import React, { useState, useEffect } from "react";

const App = () => {
  const [weather, setWeather] = useState({});

  useEffect(() => {
    fetch(
      "http://api.openweathermap.org/data/2.5/forecast?q=londen&units=metric&APPID=e771e8e6a985601ac3b1da6821bd3122"
    );
  });

  return <h1>hallo</h1>;
};

export default App;
